import React, { useEffect, useState } from 'react';
import {GetMenuForm} from '../components/GetMenuForm';
import Typography from '@mui/material/Typography';
import { AddFoodForm } from '../components/AddFoodForm';


const Home = () => {
    const [foodDisplay, setFoodDisplay] = useState({
        "Soup": {
            "First Soup": [
                "Chicken", "Beef"
            ],
            "Second Soup": [
                "Veggies", "Taro"
            ]
        }
    })
    const [foodAmounts, setFoodAmounts] = useState({
        Chicken: 1, 
        Beef: 2
    })
    const [foodFacts, setFoodFacts] = useState({
        "Chicken": {
            "Calories": 300, 
            "Protein": 20,
            "Carbs": 40,
            "Fats": 10
        },
        "Beef": {
            "Calories": 250,
            "Protein": 25,
            "Carbs": 40,
            "Fats": 10
        }
    })    
    const FoodHandler = (newFood) => {
        setFoodDisplay(newFood[0])
        setFoodAmounts(newFood[1])
        setFoodFacts(newFood[2])
    }

    return (
        <div>
        <Typography variant="h2" className="main-header">MDining Nutrition Calculator</Typography>
        {/* {if(menu == {})} */}
        <GetMenuForm onFoodHandler={FoodHandler}/>
        {
            // (Object.keys(foodDisplay).length === 0) ? <AddFoodForm /> : null
            (Object.keys(foodDisplay).length === 0) ? console.log(12) : null
        }
        {/* <AddFoodForm /> */}
        </div>
    );
}

export default Home;
